    "2016-08-04T08:17:40.290579",nt"name": "alaska-peninsula-becharof-national-wildlife-refuges-annual-narrative-report-calendar-yea-1-23cd6",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Alaska
    Peninsula and Becharof NWRs outlines Refuge accomplishments during the 1988 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, management planning, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands and wilderness areas. The wildlife section
    of the report discusses waterfowl, game mammals, marine mammals, fisheries resources,
    and marking and bird banding. The public uses of the Refuge described in this report
    include interpretive programs, hunting, fishing, trapping, outdoor recreation, and
    law enforcement. The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment replacement,
    communication systems, computer systems, and energy conservation. Economic uses
    of the Refuge and items of interest are provided at the end.",nt"license_title":
